import React, { Component } from 'react';
import ask from './ask.jpg';
import send from './send.jpg';


class AskSend extends Component {
  render() {
    return (
      <div>
      <img src ={ask} alt="Ask for Healing"></img>
        <h1 className="askSend">Ask For Healing</h1>
        <img src ={send}></img>
        <h1 className="askSend" alt="Send Love">Send Healing</h1>
      </div>
    )
  }
};

export default AskSend;
